"""
2. Отсортируйте по возрастанию методом слияния одномерный вещественный массив,
заданный случайными числами на промежутке [0; 50). Выведите на экран исходный
и отсортированный массивы.

Хотя в примерах к уроку уже есть вариант реализации слияния,
попробуйте предложить другой (придумать или найти).

И попытаться сделать замеры на массивах разной длины: 10, 100, 1000, ...

Пример:
Введите число элементов: 5
Исходный - [46.11436617832828, 41.62921998361278, 18.45859540989644, 12.128870723745806, 8.025098788570562]
Отсортированный - [8.025098788570562, 12.128870723745806, 18.45859540989644, 41.62921998361278, 46.11436617832828]
"""
import collections
import timeit
import random


def merge_sort(arr):
    if len(arr) <= 1:
        return
    L, R = arr[:len(arr) // 2], arr[len(arr) // 2:]
    merge_sort(L)
    merge_sort(R)
    l = r = c = 0
    C = [0] * (len(L) + len(R))
    while l < len(L) and r < len(R):
        if L[l] <= R[r]:
            C[c] = L[l]
            l += 1
        else:
            C[c] = R[r]
            r += 1
        c += 1
    while l < len(L):
        C[c] = L[l]
        l += 1
        c += 1
    while r < len(R):
        C[c] = R[r]
        r += 1
        c += 1
    for i in range(len(arr)):
        arr[i] = C[i]
    return arr


def merge_sort_my(A):
    if len(A) <= 1: return A
    left, right = merge_sort_my(A[:len(A) // 2]), merge_sort_my(A[len(A) // 2:])
    srtd = []
    while left or right:
        if left and right:
            srtd.append(left.pop(0)) if left[0] < right[0] else srtd.append(right.pop(0))

        elif right and not left:
            srtd.append(right.pop(0))

        elif left and not right:
            srtd.append(left.pop(0))

    return srtd


